const AppRouter = () => {
    // const { authenticated } = useAuth();

    return (
        <BrowserRouter>
            <Routes>
                {routes.map(({ path, element }, index) => (
                    <Route
                        key={index}
                        path={path}
                        element={element}
                    />

                ))}
            </Routes>
        </BrowserRouter>
    );
};

export default AppRouter;
